def sod(a):
  digs = []
  tot = 0
  for i in str(a):
    digs.append(int(i))
  for j in digs:
    tot += math.factorial(j)
  return tot

def findChain(a):
  result = sod(a)
  results = [a]
  while result not in results:
    results.append(result)
    result = sod(result)
  r = results.index(result)
  return [results, results[r:]]

